int mex[5001][5001];
unordered_set<int> v[5005];
int ans = 0;
void solve(int i, int prev) {
  ans = max(ans, prev);
  if (i == n) return;
  if (v[i].count(prev)) return;
  v[i].insert(prev);
  for (int j = 0; j + i < n; ++j) {
    solve(i + j + 1, prev);
    solve(i + j + 1, prev ^ mex[i][i + j]);
  }
}

