    for (int i = 0; i < n; ++i) {
      set<int> x;
      for (int j = 0; j <= n + 1; ++j) x.insert(j);
      for (int j = i; j < n; ++j) {
        x.erase(a[j]);
        mex[i][j] = *x.begin();
      }
    }
    ans = 0;
    solve(0, 0);
    cout << ans << "\n";
  }
}

