    }

    if (input == "Close") {
        cout << "Store is closed!\n"
            << soldEggs << " eggs sold.\n";
    }
    else {
        cout << "Not enough eggs in store!\n"
            << "You can buy only " << availableEggs << ".\n";
    }
    return 0;
}
